import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Navbar from "./componenets/Navbar";
import Home from "./componenets/home";

function App() {
  return (
    <>
      <router>
        <Navbar />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route exa path="/About">
            <About />
          </Route>
        </Switch>
      </router>
    </>
  );
}

export default App;
